import { createApp } from 'vue'

import App from './App.vue'
import {  Form ,Input, InputPassword, Checkbox, Button, FormItem, Menu} from 'ant-design-vue';
import 'ant-design-vue/dist/reset.css';
const app = createApp(App);



app.use(Button).use(Form).use(Input).use(InputPassword).use(Checkbox).use(FormItem).use(Menu).mount('#app');
